import img1 from './img/img1.jpg';
import img2 from './img/img2.jpg';
import img3 from './img/img3.jpg';
import img4 from './img/img4.jpg';

const data = {
    cardData: [
        {
            id:1,
            img: img1,
            title: 'property 1',
            desc: 'price: Rs. 1 Crore'
        },

        {
            id:2,
            img: img2,
            title: 'property 2',
            desc: 'price: Rs. 1.5 Crore'
        },

        {
            id:3,
            img: img3,
            title: 'property 3',
            desc: 'price: Rs. 2.5 Crore'
        },

        {
            id:4,
            img: img4,
            title: 'property 4',
            desc: 'price: Rs. 4 Crore'
        },

        {
            id:5,
            img: img1,
            title: 'property 5',
            desc: 'price: Rs. 3.5 Crore'
        },

        {
            id:6,
            img: img2,
            title: 'property 6',
            desc: 'price: Rs. 6 Crore'
        },

        {
            id:7,
            img: img3,
            title: 'property 7',
            desc: 'price: Rs. 4 Crore'
        },

        {
            id:8,
            img: img4,
            title: 'property 8',
            desc: 'price: Rs. 7 Crore'
        }


    ]
}


export default data;
